@익명 이놈 웃기네 ㅋㅋㅋㅋ 게임의 일부라면서 엄청 대응하고 있는데 여자 4명이서 집단퇴소하는건 너도 게임의 일부라고 못보나보지? ㅋㅋㅋㅋ 내가 언제 제작진 잘못 없다고 했냐? 지금 얘기하는 주 내용이 파이와 관련된 거니까 파이에 대한 집단퇴소 장면에 대해서 말하고 있는데 여기에 그럼 제작진 잘못도 있으니까 제작진한테도 뭐라고 해~ 식으로 말하네 ㅋㅋㅋㅋ
전체와 부분 논리좀 제대로 다시 공부좀 하고 와라 모르는게 있으면 배우기라도 해야지
제발 논점좀 흐리지 마라

가오게이형이 진짜 성격 존내좋아보임 ㄹㅇ;
같이다니면 시비걸렸을때 나 대신 다싸워줄거같고
존나 결혼마렵다
